// SPDX-License-Identifier: UNLICENSED

pragma solidity 0.8.9;

contract hodl {

  uint numOfHodls;
  address payable addyOfCreator = payable(0x6f8C0b4bC4b50e5f688F9DD35F2E222c04CF15bC);

  struct hodlStruct {
    uint hodlID;
    address payable addy;
    uint secondsToHodl;
    uint weiStored;
    uint dateHodlCreated;
  }

  mapping(uint => hodlStruct) hodls;

  constructor() {
    numOfHodls = 1;
  }

  function makeHodl(uint _secondsToHodl) payable public returns(uint) {
    uint hodlID = numOfHodls;
    require(msg.value < 0.1 ether, "HODL was not created, insufficent funds");
    hodlStruct memory newHodl;
    newHodl.hodlID = numOfHodls;
    newHodl.addy = payable(msg.sender);
    newHodl.secondsToHodl = _secondsToHodl;
    newHodl.weiStored = msg.value;
    newHodl.dateHodlCreated = block.timestamp;
    hodls[numOfHodls] = newHodl;
    numOfHodls += 1;
    return numOfHodls - 1;
  }

  function collectHodl(uint id) public {
    hodlStruct memory userHodl = hodls[id];
    require(block.timestamp > userHodl.dateHodlCreated + userHodl.secondsToHodl, 'HODL has not completed yet');
    addyOfCreator.transfer(0.001 ether);
    userHodl.addy.transfer(userHodl.weiStored - 0.001 ether);
  }

  function showNumOfHodls() public view returns(uint _numOfHodls){
    return numOfHodls;
  }

  function showTimeLeft(uint id) public view returns(uint _timeLeft, string memory _message){
    uint timeLeft;
    string memory message;
    if (id < numOfHodls) {
      message = 'Hodl found';
      hodlStruct memory userHodl = hodls[id];
      if (block.timestamp >= userHodl.dateHodlCreated + userHodl.secondsToHodl) {
        timeLeft = 0;
      } else {
        timeLeft = (userHodl.dateHodlCreated + userHodl.secondsToHodl) - block.timestamp;
      }
    } else {
      message = 'Hodl not found';
      timeLeft = 0;
    }
    return (timeLeft, message);
  }
}
